import './App.css';
import { useState, useEffect } from "react";
import { Routes, Route } from 'react-router-dom';
import Main from './components/pages/Main';
import References from './components/pages/References';
import Header from './components/layouts/Header';
import Footer from './components/layouts/Footer';
import Elado from './components/pages/Elado';
import MostEpul from './components/pages/MostEpul';
import ReferenceDetail from './components/ReferenceDetail';
import {  ReferenceProvider } from './ReferenceContext';

function App() {
  const [mostEpul, setMostEpul] = useState({});
  useEffect(() => {
    fetch("https://api-eu-central-1.graphcms.com/v2/ckwq5z05y2e8n01xmgomm92ka/master?query=query%20MyQuery%20%7B%0A%20%20mostEpuls%20%7B%0A%20%20%20%20id%0A%20%20%20%20title%0A%20%20%20%20gallery%20%7B%0A%20%20%20%20%20%20fileName%0A%20%20%20%20%7D%0A%20%20%7D%0A%7D%0A&operationName=MyQuery")
      .then(res => res.json())
      .then(json => setMostEpul(json.data.mostEpuls));
  }, [])

  // console.log(mostEpul)
  return (
    <div>
        <Header />
        <ReferenceProvider>
          <Routes>
              <Route exact path='/' element={<Main />}/>
              <Route path='/referenciak' element={<References />}/>
              <Route path='/referenciak/:project' element={<ReferenceDetail />}/>
              <Route path='/most-epul' element={<MostEpul />}/>
              <Route path='/elado' element={<Elado />}/>
          </Routes>
        </ReferenceProvider>
        <Footer />
    </div>
  );
}

export default App;
